import { lazy, useEffect } from 'react';
import { BrowserRouter, Route, Routes, useNavigate } from 'react-router-dom';
import { Home } from './modules/Home';
import { Explore } from './modules/Explore';

const LazyHome = lazy(() => Promise.resolve({ default: Home }));
const LazyExplore = lazy(() => Promise.resolve({ default: Explore }));
// const RevisionDetails = lazy(() => import('pages/RevisionDetails'));
// const NoAccessPage = lazy(() => import('pages/NoAccessPage'));

export const Routers = () => {
  const navigate = useNavigate();

  useEffect(() => {
    navigate('/dish');
  }, [navigate]);

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/dish' element={<LazyHome />} />
        <Route path='/dish/explore' element={<Explore />} />
        {/* <Route path='/dish' render={() => <Redirect to='/explore' />} /> */}
        {/* <Route path='/' element={<Navigate to='/dish' />} /> */}
      </Routes>
    </BrowserRouter>
  );
};
